import Slideshow from '../Slideshow'

function MySlideshow(images) {
    return (
        <Slideshow>
            const images = [images]
            {images.map((image, index) => (
                <div
                    key={index}
                    className="demo-item"
                    style={{ backgroundImage: 'url(' + image.src + ')' }}
                />
            ))}
        </Slideshow>
    )
};

export default MySlideshow
